import React,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Body.css';
import {
    BrowserRouter as Router,
    Route, Link
  } from "react-router-dom";
class Body extends Component {
  render(){
  return (
    <Router>
      <div className=""></div>
        <div className="row body-bottom">
          <div className="col-6"> 
            <img src="http://localhost:4000/anh"  className="" alt="a"></img>
          </div>
          <div className="col-3 center formsearch border-bottom1"> 
            <div className="row" >
             <div className="col-10">
              <input type="text" class="form-control-plaintext" id="search" placeholder="search"></input>
             </div>
             <div className="col-2">
              <button type="button" class="btn btn-outline button-search"><i class="fas fa-search"></i></button>
             </div>
            </div>
          </div>
          <div className="col-3 left shop">
            <div className="row">
              <div className="col shop-div">
                <i class="fas fa-shopping-cart size50"></i>
              </div>
              <div className="col shop-div">
                <p className="shop-div-p">Giỏ Hàng</p>
                <p> 0 đ</p>
              </div>
            </div>
          </div>
        </div>

</Router>
    
  );
}}

export default Body;
